text:
day 338. hannah gadsby is an extraordinary fucking witch. fuck. after being the international sensation of 2018 with her ground-breaking, comedy-busting routine “nanette”, now she’s taken her razor-sharp bullshit-detector to all the “good men” who keep making the rules about sexual misconduct:
“ ‘we need to talk about how men will draw a different line for every different occasion. they have a line for the locker room; a line for when their wives, mothers, daughters, and sisters are watching; another line for when they’re drunk and fratting; another line for nondisclosure; a line for friends; and a line for foes.’ “ (from junkee) 
fuck. how fucking brilliant is that. how fucking perfectly does she explain:
- the way dipshit men always and forever want to keep fucking control of these decisions and behaviour they’ve no fucking idea about solely for themselves and their slothbastard mates;
- the way arseknuckle men aren’t conditioned to ever choose to listen, defer judgement, express empathy, or ask questions of traumatised women;
- the way fucktangle men get to rationalise and change their judgement and behaviour depending on whether the perp was a stranger in the bushes or their best fucking mate;
- the way dicktodger men get to calmly assess women’s believability and judge survivors on whether their behaviour afterwards was demure enough and whether their class, appearance, sobriety, career and/or mental health was pleasing enough;
- the way creepy frogterducken men have nfi how their bullshit opinions on these issues affect generations of women who don’t report and regret reporting because they so clearly see how their entire futures rest on the wankerish judgement of these dangerous dickpuffins, and how this increases the incidence of rape;
- the way shitgibbon men will almost always side with another man’s judgement and will on these issues rather than a woman’s; - the way crapburgler men keep firm control of the airwaves, newsprint, discourse, corporations and governments to maintain these fucked narratives to the death;
- the way women know that even if they’re believed, that decision is a perilous knife edge. fuck.  #metoo #timesup

